$(document).ready(function(){$(".artist-suggestion").autocomplete({minLength:3,source:function(n,t){var i=$(".artist-suggestion").attr("artist-suggestion-url");(console.log("hitting url: "+i),i!==undefined)&&$.ajax({url:i,type:"GET",dataType:"json",data:n,success:function(n){t($.map(n,function(n){return{label:n.name,id:n.id,url:n.imgUrl}}))}})},select:function(n,t){$(".artist-id").val(t.item.id)}}).autocomplete("instance")._renderItem=function(n,t){return $('<li class="list-group-item autocomplete-item">').append("<div>"+t.label+"<\/div>").appendTo(n)}});